import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookingSystem = () => {
    const [bookings, setBookings] = useState([]);
    const [newBooking, setNewBooking] = useState({
        name: '',
        contactNumber: '',
        email: '',
        paymentAmount: 0,
        startTime: '',
        endTime: '',
        status: 'Upcoming',
    });

    useEffect(() => {
        fetchBookings();
    }, []);

    const fetchBookings = async () => {
        const response = await axios.get('/bookings/getAllBookings');
        setBookings(response.data);
    };

    const createBooking = async () => {
        await axios.post('/bookings/createBooking', newBooking);
        fetchBookings(); // Refresh bookings
        setNewBooking({ name: '', contactNumber: '', email: '', paymentAmount: 0, startTime: '', endTime: '', status: 'Upcoming' }); // Reset form
    };

    const updateBooking = async (id, updatedDetails) => {
        await axios.put(`/bookings/updateBooking/${id}`, updatedDetails);
        fetchBookings(); // Refresh bookings
    };

    const deleteBooking = async (id) => {
        await axios.delete(`/bookings/deleteBooking/${id}`);
        fetchBookings(); // Refresh bookings
    };

    return (
        <div>
            <h1>Booking System</h1>

            <h2>Create New Booking</h2>
            <input 
                type="text" 
                placeholder="Name" 
                value={newBooking.name} 
                onChange={(e) => setNewBooking({ ...newBooking, name: e.target.value })} 
            />
            <input 
                type="text" 
                placeholder="Contact Number" 
                value={newBooking.contactNumber} 
                onChange={(e) => setNewBooking({ ...newBooking, contactNumber: e.target.value })} 
            />
            <input 
                type="email" 
                placeholder="Email (@cit.edu)" 
                value={newBooking.email} 
                onChange={(e) => setNewBooking({ ...newBooking, email: e.target.value })} 
            />
            <input 
                type="number" 
                placeholder="Payment Amount" 
                value={newBooking.paymentAmount} 
                onChange={(e) => setNewBooking({ ...newBooking, paymentAmount: e.target.value })} 
            />
            <input 
                type="time" 
                placeholder="Start Time" 
                value={newBooking.startTime} 
                onChange={(e) => setNewBooking({ ...newBooking, startTime: e.target.value })} 
            />
            <input 
                type="time" 
                placeholder="End Time" 
                value={newBooking.endTime} 
                onChange={(e) => setNewBooking({ ...newBooking, endTime: e.target.value })} 
            />
            <button onClick={createBooking}>Create Booking</button>

            <h2>Current Bookings</h2>
            <ul>
                {bookings.map(booking => (
                    <li key={booking.bookingId}>
                        <p>Name: {booking.name}</p>
                        <p>Contact Number: {booking.contactNumber}</p>
                        <p>Email: {booking.email}</p>
                        <p>Payment Amount: ${booking.paymentAmount}</p>
                        <p>Start Time: {booking.startTime}</p>
                        <p>End Time: {booking.endTime}</p>
                        <p>Status: {booking.status}</p>
                        <button onClick={() => updateBooking(booking.bookingId, { ...booking, status: 'Completed' })}>
                            Mark as Completed
                        </button>
                        <button onClick={() => deleteBooking(booking.bookingId)}>
                            Delete Booking
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default BookingSystem;
